import React, { useState } from 'react';
import axios from 'axios';

function Api() {

    const [apidata,setApidata]=useState([]);


    const fetchApi=()=>{
        axios.get(`https://fakestoreapi.com/`)
        .then((response)=>{
            console.log(response);

            setApidata(response.data)
        })
    }
  return (
    <>

       <button className='button' onClick={fetchApi}>Click me</button>

       {
        apidata.map((data)=>{
          return(
            <>
               <p>firstName:{data.id}</p>
               <p>lastName:{data.title}</p>
               <p>Password:{data.price}</p>
               <p>firstName:{data.albumId}</p>
            </>
          )
        })  
        }
    </>
  );

}

export default Api;
